values  (7, true, '2021-01-14 10:53:57.650570', 'Sljeme je vrh Medvednice, planine iznad Zagreba. Nalazi se na 1033 metara nadmorske visine. Do Sljemena vodi asfaltirana cesta, mnogobrojne pješačke staze, a od 1963. do 2007. u pogonu je bila i sljemenska žičara. Sljeme je jedno od najdražih izletišta Zagrepčana.Na Sljemenu se nalazi i skijaška staza koja je jedna od lokacija za utrke svjetskog skijaškog kupa (Snježna kraljica). Na samom vrhu nalazi se RTV toranj, visok 169 metara koji je izgrađen 1973.', 5, null, E''\\xACED00057372001C6A6176612E6177742E67656F6D2E506F696E74324424446F75626C65555BF8CA09A31D5F020002440001784400017978704046F31FFB8D5A0C402FE54EDBE3B45C'', 'Sljeme', false, 'https://upload.wikimedia.org/wikipedia/commons/thumb/8/8a/Sljeme.jpg/435px-Sljeme.jpg', 0, 5, 3, 3),
        (8, true, '2021-01-14 10:53:57.889428', 'Trg bana Josipa Jelačića glavni je zagrebački trg. Njime dominira kip bana Josipa Jelačića kipara Dominika Fernkorna, danas okrenut prema jugu. Od nakon Drugoga svjetskoga rata do 1990. godine, kada mu je vraćeno staro ime, trg je nosio ime Trg Republike.', 6, null, E''\\xACED00057372001C6A6176612E6177742E67656F6D2E506F696E74324424446F75626C65555BF8CA09A31D5F020002440001784400017978704046E814624FC5FA402FF4470568FCBA'', 'Trg Bana Jelačića', false, 'https://www.zagrebonline.hr/wp-content/uploads/2012/03/trga-bana-jelacica.jpg', 0, 6, 3, 3),
        (9, true, '2021-01-14 10:53:57.994364', 'Katedrala Uznesenja Blažene Djevice Marije i svetih Stjepana i Ladislava ili Zagrebačka katedrala, najveća je hrvatska sakralna građevina i jedan od najvrjednijih spomenika hrvatske kulturne baštine. Prva je i najznačajnija gotička građevina Hrvatske. Najmonumentalija je gotička sakralna građevina jugoistočno od Alpa.', 4, null, E''\\xACED00057372001C6A6176612E6177742E67656F6D2E506F696E74324424446F75626C65555BF8CA09A31D5F020002440001784400017978704046E8342D77F7E9402FF5793B685FE0'', 'Zagrebačka katedrala', false, 'https://upload.wikimedia.org/wikipedia/commons/thumb/b/b9/Zagreb_Cathedral_2020.jpg/390px-Zagreb_Cathedral_2020.jpg', 2, 3, 3, 3),
        (10, true, '2021-01-14 10:53:58.044977', 'Crkva svetoga Marka jedan je od najstarijih građevnih spomenika grada Zagreba. Smještena je na Trgu svetoga Marka, kao i Hrvatski sabor. Crkva sv. Marka Evanđelista zaštićeno je kulturno dobro Republike Hrvatske.', 4, null, E''\\xACED00057372001C6A6176612E6177742E67656F6D2E506F696E74324424446F75626C65555BF8CA09A31D5F020002440001784400017978704046E875A591C493402FF281AE6926D8'', 'Crkva sv. Marka', false, 'https://upload.wikimedia.org/wikipedia/commons/thumb/f/f5/St_Marks_Church_Zagreb.jpg/450px-St_Marks_Church_Zagreb.jpg', 0, 4, 3, 3),
        (11, true, '2021-01-14 10:53:58.097876', 'Dana 14. listopada 1895. u Zagrebu svečano je otvorena kazališna zgrada za oko 750 gledatelja u kojoj danas djeluje Hrvatsko narodno kazalište. Neobarokna zgrada HNK je remek-djelo kasnog historizma austrijskog arhitekta Ferdinanda Fellnera i njemačkog arhitekta Hermanna Helmera.', 2, null, E''\\xACED00057372001C6A6176612E6177742E67656F6D2E506F696E74324424446F75626C65555BF8CA09A31D5F020002440001784400017978704046E79E8816DF31402FF0A90168A40F'', 'Hrvatsko Narodno Kazalište', false, 'https://upload.wikimedia.org/wikipedia/commons/thumb/0/01/Hrvatsko_narodno_kazaliste_u_Zagrebu_090609.jpg/330px-Hrvatsko_narodno_kazaliste_u_Zagrebu_090609.jpg', 5, 2, 3, 3),
