        (44, true, '2021-01-14 10:53:58.273799', 'Antička palača cara Dioklecijana u Splitu.Oko 300. godine podigao ju je rimski car Dioklecijan i u njoj je boravio nakon povlačenja s prijestolja (305.g.) do smrti (316.g.).', 3, null, E''\\xACED00057372001C6A6176612E6177742E67656F6D2E506F696E74324424446F75626C65555BF8CA09A31D5F020002440001784400017978704045C09E4FFFD03840306FB36D4CABF8'', 'Dioklecijanova palača', false, 'https://upload.wikimedia.org/wikipedia/commons/thumb/1/1a/Peristyle_of_Diocletian%27s_Palace%2C_Split_%2811908116224%29.jpg/1280px-Peristyle_of_Diocletian%27s_Palace%2C_Split_%2811908116224%29.jpg', 9, 3, 1, 1),
        (45, true, '2021-01-14 10:53:58.273959', 'Uspinjača je u prošlosti imala važnu ulogu u životu stanovnika Zagreba, a danas je značajna turistička atrakcija u kojoj se vole prevesti mnogobrojni turisti. Ideja uspinjače bila je povezati Donji i Gornji grad, a s prugom od samo 66 metara – ovo je najkraća žičana željeznica na svijetu.', 1, null, E''\\xACED00057372001C6A6176612E6177742E67656F6D2E506F696E74324424446F75626C65555BF8CA09A31D5F020002440001784400017978704046E83BBE45F29A402FF2359126DEEE'', 'Uspinjača', false, 'https://www.internationalbusinesshotel.com/uploads/images/_1024x682_fit_center-center_75_none/funicular-m-vrdoljak-592bfbe3415b2_190809_095319.png', 9, 1, 1, 1),
        (46, true, '2021-01-14 10:53:58.274126', 'Tunel ispod Gradeca (Griča) koji povezuje Mesničku i Radićevu ulicu, a okomito izlazi na tri mjesta u Ilici i jednom u Tomićevoj ulici prema jugu. Tunel je dugačak 350 metara, svojim većim dijelom širok je 3,2 metra dok je u središnjem dijelu širok 5,5 metara. Otvoren je za javnost u srpnju 2016. godine, iako je ranije bio otvoren kao sklonište za građane i mjesto kulturnih događanja tijekom Domovinskog rata.', 5, null, E''\\xACED00057372001C6A6176612E6177742E67656F6D2E506F696E74324424446F75626C65555BF8CA09A31D5F020002440001784400017978704046E8537A88EE14402FF1297E7E8B20'', 'Tunel Grič', false, 'https://upload.wikimedia.org/wikipedia/commons/thumb/7/7f/Tunel_Gri%C4%8D_Mesni%C4%8Dka_2016.jpg/800px-Tunel_Gri%C4%8D_Mesni%C4%8Dka_2016.jpg', 6, 5, 1, 1),
        (47, true, '2021-01-14 10:53:58.274223', 'Skultpure su postavljene na inicijativu akademskog kipara Ratka Petrića u okviru sekcije Prijedlog zagrebačkog salona 1985. godine.', 5, null, E''\\xACED00057372001C6A6176612E6177742E67656F6D2E506F696E74324424446F75626C65555BF8CA09A31D5F020002440001784400017978704046E507A2AE48B9402FEE73379338C2'', 'Aleja Skulptura', false, 'http://licegrada.hr/wp-content/uploads/2016/08/aleja-skulptura-01032015-2.jpg', 4, 8, 1, 1),
        (48, true, '2021-01-14 10:53:58.274407', 'Zvonimir "Ševa" Levačić (Zagreb, 12. prosinca 1943. – 5. svibnja 2010.), hrvatska televizijska osoba. Jedan od sudionika i "glavnih sporednih" zvijezda televizijske emisije Noćne more Željka Malnara. Dionik komičarskog parodijskog projekta države Pešćenice. Pobijedio je Dennisa Rodmana na izvođenju slobodnih bacanja.', 9, null, E''\\xACED00057372001C6A6176612E6177742E67656F6D2E506F696E74324424446F75626C65555BF8CA09A31D5F020002440001784400017978704046E51E9DCFDF26402FE7405AB90921'', 'Ševin mural na Knežiji, Zagreb', false, 'https://img.24sata.hr/xXQg9b--nCIzFU1iDkXM_qbYjsk=/1600x1066/smart/media/images/2020-46/pxl-191120-30886840.jpg', 9, 9, 1, 1),
